import React from "react";

function Account() {
  // Sample data to demonstrate the table
  const data = {
    id: 1,
    first_name: "John",
    last_name: "Doe",
    username: "johndoe",
    email: "john@example.com",
    age: 30,
    location: "New York",
    gender: "Male",
    seeking_gender: "Female",
    marital_status: "Single",
